import React from 'react';
import FormNewItem from './FormNewItem';
import Card from '../UI/Card';
import './NewItem.css';

function NewItem(props) {
    return (
        <Card className="new-todo">
            <h1 className="new-todo__text">Course Goal</h1>
            <FormNewItem {...props} />
        </Card>
    );
}

export default NewItem;
